"use client"
import React, { useState } from 'react';
import { useRouter } from 'next/navigation';
import { Card, CardContent, CardFooter, CardHeader, CardTitle } from "@/components/ui/card";
import { Button } from "@/components/ui/button";
import { Heart, Loader2, Share2, Store } from 'lucide-react';
import { useQuery, useMutation } from 'convex/react';
import { api } from '../../../convex/_generated/api';
import { Id } from '../../../convex/_generated/dataModel';
import lz from "lzutf8"
import EcomLandingPng from "../../../public/ecommerse landing.png"
import Image from 'next/image';
import { ArrowRight } from 'lucide-react';
import { motion } from 'framer-motion';
import BlogLandingPng from "../../../public/BlogLandingPng.png"
import BlogDetailPng from "../../../public/BlogLandingPng.png"
import StoreCollectionPng from "../../../public/EcommerseFeaturedStore.png"
import RentalLandingPng from "../../../public/RentalLandingPng.png"
import LmsLandingPng from "../../../public/LmsLandingReal.png"

interface Template {
  _id: Id<"templates">;
  title: string;
  data: string;
  image?: string;
}

interface TemplateFolder {
  id: any
  src: any
  alt: any;
  data: any
}

const TemplateCard: React.FC<{ template: Template; onSelect: () => void }> = ({ template, onSelect }) => (
  <Card className="w-full">
    <CardHeader>
      <CardTitle>{template.title}</CardTitle>
    </CardHeader>
    <CardContent>
      {template.image && <img src={template.image} alt={template.title} className="w-full h-48 object-cover" />}
    </CardContent>
    <CardFooter className="flex justify-between">
      <Button variant="outline" size="icon">
        <Heart className="h-4 w-4" />
      </Button>
      <Button variant="outline" size="icon">
        <Share2 className="h-4 w-4" />
      </Button>
      <Button onClick={onSelect}>Select</Button>
    </CardFooter>
  </Card>
);

const TemplateSection: React.FC = () => {

  const createProjectWithTemplate = useMutation(api.project.createProjectWithTemplate);
  const router = useRouter();
  const [selectedTemplate, setSelectedTemplate] = useState<TemplateFolder | null>(null);
  const [isLoading, setIsLoading] = useState(false);
  const [isHeroLoading, setIsHeroLoading] = useState(false);

  
  const templateFolder: TemplateFolder[] = [
    { id: 1, src: RentalLandingPng, alt: 'Rental' , data:"" },
    { id: 2, src: BlogLandingPng, alt: 'Blog Landing',data:"" },
    { id: 3, src: LmsLandingPng, alt: 'LMS', data: "" },
    { id: 4, src: BlogDetailPng, alt: 'Blog Detail ', data: "" },
    { id: 5, src: EcomLandingPng, alt: 'Ecommerse', data: "" },
    {id: 6,src: StoreCollectionPng, alt: "Store" , data:""}  ];


  const handleClick = async (template:TemplateFolder) => {
    setIsLoading(true);
    setSelectedTemplate(template);
    try {
      const projectId = await createProjectWithTemplate({
        title: template.alt,
        savedState: template.data
      });
      router.push(`/build/${projectId}`);
    } catch (error) {
      console.error("Failed to create project:", error);
      alert("An error occurred while creating the project. Please try again.");
    }finally {
      setTimeout(() => {
        setIsLoading(false);
      }, 3000);
    }
  };


  const handleClickHero = async() => {
    setIsHeroLoading(true)
    try {
      const projectId = await createProjectWithTemplate({
        title: "Ecommerse",
        savedState: "" });
      router.push(`/build/${projectId}`);
    } catch (error) {
      console.error("Failed to create project:", error);
      alert("An error occurred while creating the project. Please try again.");
    } finally {
      setTimeout(() => {
        setIsHeroLoading(false);
      }, 3000);
    }
  };


  return (
    <div className="w-full relative flex flex-col px-4 py-8">
      <div className="flex flex-col md:flex-row items-center justify-between py-5 md:py-10">
        <div className="flex flex-col items-center mt-8 w-full md:w-1/2">
          <span className="text-3xl md:text-5xl flex flex-col gap-y-2 font-extrabold tracking-tighter text-[#4A4A4A] bg-[#F8F9FA] text-center md:text-left">
            Try different{' '}
            <span className="text-5xl md:text-8xl tracking-tight bg-gradient-to-r from-[#D16BA5] to-[#5B2C83] bg-clip-text text-transparent">
              Template&apos;s
            </span>
            <span className='text-2xl md:text-4xl'>
              to have a walk through of this app
            </span>
          </span>
        </div>
        <motion.div
          onClick={handleClickHero}
          className='mt-8 md:mt-0 flex flex-col items-center md:ml-4 border border-purple-500 rounded-lg shadow-lg overflow-hidden w-full md:w-1/2 cursor-pointer relative'
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
          whileHover={{ scale: 1.05, boxShadow: "0 10px 20px rgba(0,0,0,0.2)" }}
        >
          <Image
            src={EcomLandingPng}
            alt='Ecom-Landing'
            width={1000}
            height={800}
            className='rounded-lg object-cover w-full h-auto'
          />
          {isHeroLoading && (
            <div className="absolute inset-0 bg-black bg-opacity-50 flex items-center justify-center">
              <Loader2 className="w-16 h-16 animate-spin text-purple-500" />
            </div>
          )}
        </motion.div>
      </div>
      <div className="mt-16 grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8 max-w-7xl mx-auto">
        {templateFolder.map((template) => (
          <div key={template.id}>
            <motion.div
              onClick={() => handleClick(template)}
              className="relative group border border-purple-500 rounded-md shadow-lg overflow-hidden cursor-pointer"
              whileHover={{ scale: 1.05 }}
              transition={{ duration: 0.3 }}
            >
              <Image
                src={template.src}
                alt={template.alt}
                width={800}
                height={500}
                className="rounded-lg shadow-md w-full h-auto"
              />
              {isLoading && selectedTemplate?.id === template.id ? (
                <div className="absolute inset-0 bg-black bg-opacity-50 flex items-center justify-center">
                  <Loader2 className="w-16 h-16 animate-spin text-purple-500" />
                </div>
              ) : (
                <motion.div
                  className="absolute inset-0 flex items-center justify-center bg-black bg-opacity-50 rounded-lg opacity-0 group-hover:opacity-100 transition-opacity duration-300"
                  initial={{ opacity: 0 }}
                  animate={{ opacity: 0 }}
                  whileHover={{ opacity: 1 }}
                >
                  <motion.a
                    className="text-white flex items-center gap-2"
                    whileHover={{ x: 5 }}
                    transition={{ duration: 0.2 }}
                  >
                    View Template
                    <motion.span
                      initial={{ x: -5, opacity: 0 }}
                      animate={{ x: 0, opacity: 1 }}
                      transition={{ duration: 0.2 }}
                    >
                      <ArrowRight size={20} />
                    </motion.span>
                  </motion.a>
                </motion.div>
              )}
            </motion.div>
            <h3 className="mt-4 text-base md:text-lg font-semibold text-gray-800 tracking-wide text-center">
              {template.alt.replace(/-/g, ' ')}
            </h3>
          </div>
        ))}
      </div>
    </div>
  );
}


export default TemplateSection;